me forth to battle the Burning Legion. Though the colossal boar fell in combat, his actions helped save Azeroth from ruin. Yet over time, in the areas where his blood fell, massive thorn-ridden vines sprouted from the earth.\n\nThe quillboar - believed to be the mortal offspring of the mighty god, came to occupy these regions and hold them sacred. The heart of these thorn-colonies was known as the Razorfen. The great mass of Razorfen Kraul was conquered by the old crone, Charlga Razorflank. Under her rule, the shamanistic quillboar stage attacks on rival tribes as well as Horde villages. Some speculate that Charlga has even been negotiating with agents of the Scourge - aligning her unsuspecting tribe with the ranks of the Undead for some insidious purpose.",lvl=17,mapID=301,["zone-text-areaID"]=491,g={n(-1000031,{q(1102,{coords={{36.2,59.8,1456}},lvl=29,qgs={4451},r=1,rwp=40003,g={qo(1,{providers={{"i",5793}}}),i(6725,{b=1,f=8,rwp=40003}),i(4197,{b=1,f=4,rwp=40003}),i(6742,{b=1,f=6,filterForRWP=7,rwp=40003})}}),q(6522,{lvl=28,maps={1458},providers={{"i",17008}},r=1,u=2}),q(14352,{awp=30300,lvl=28,maps={1458},providers={{"i",49205}},r=1,rwp=40003}),q(1221,{coords={{62.4,37.6,1413}},lvl=20,qgs={3446},rwp=40003,g={qo(1,{cost={{"i",5880,1},{"i",5897,1},{"i",6684,1}},crs={4781},providers={{"i",5876}}}),i(6755,{b=1,g={i(6756,{b=1,f=113})}})}}),q(1109,{coords={{49,69.8,1458}},lvl=30,qgs={2055},r=1,rwp=40003,g={qo(1,{providers={{"i",5801}}})}}),q(1100,{coords={{30,24,1441}},lvl=29,providers={{"i",5790}},r=2,rwp=40003}),q(1142,{coords={{69.4,67.6,1457}},lvl=25,qgs={4510},r=2,rwp=40003,g={qo(1,{description="Drops from any mob in the Kraul.",providers={{"i",5825}}}),i(6751,{b=1,f=3,rwp=40003}),i(6752,{b=1,f=5,rwp=40003})}}),q(1101,{coords={{89.6,46.6,1444}},lvl=29,qgs={4048},r=2,rwp=40003,sourceQuests={1100},g={qo(1,{providers={{"i",5792}}}),i(6725,{b=1,f=8,rwp=40003}),i(4197,{b=1,f=4,rwp=40003}),i(6742,{b=1,f=6,filterForRWP=7,rwp=40003}),i(29200,{awp=20001,b=1,f=31,rwp=40003}