l trigger the item to drop. You do NOT need to have Shadowmourne equipped.",qgs={36597},questID=24914,sourceQuests={24549},u=3301,g={i(51316,{b=1,description="This item contains a lot of BoE cosmetic items that sell very well. During its time, this was used to reward other members of the raid for assisting the guild master (more than likely) with Shadowmourne for the many months it took to complete the quest chain.\n\nIn addition to being very rewarding, these quests were some of the most treasured throughout World of Warcraft's long history.",sourceQuests={24914},u=3301,g={i(51317,{b=1,description="Alexandros: Darion, my son. At last I am able to lay my eyes upon you again. The Lich King tormented me without end, Darion. Endlessly he sought to break my will, to force me to serve him, to bind me to his blade. Finally, when events demanded his full attention, he left me. The one memory I clung to Darion, the one thought that kept me from giving in, it was your sacrifice, my son. That again saved me from eternal peril.\n\nDarion: Father, father, I… I feared for your sanity, father, for you, I would give my life a thousand times.",questID=24915,u=3301,g={mnt(73313,{b=2,itemID=52200,lvl=20,u=3301})}}),i(51319,{b=1,description="Muradin: Oh lad, how I missed those endless days in Lordaeron, sharpening your skill with this dull blade. Forging you into a weapon meant to withstand the demands of a great destiny. Heh… You sure put them skills to use, didn't you lad?\n\nIf only I'd been able to stop you that day, how different things migha' been. If only I'da never discovered that accursed blade. Farewell, Arthas, my brother.",questID=24917,u=3301,g={toy(52201,{lvl=80,u=3301})}}),i(51320,{b=1,description="Uther: Arthas... Alas, hero of Azeroth. You give me a greater gift than you know. Long have I struggled to forgive the prince for his terrible transgressions. My soul has been wracked with unbearable anxiety, dark thoughts, distancing me from the light.\n\nI recall clearly... the gleam of pride in his eye as he stood before me, eager to defeat the enemies of the light... eager to defend his people, no matter the cost. It is this memory of Arthas that I choose to keep in my heart.\n\nI shall always be in your debt, friend. Thank you.",questID=24919,u=3301,g={i(52252,{f=9,lvl=80,u=3301})}}),i(51321,{b=1,description="Sylvanas: So, it is done. I had not dared to trust my senses. Too many times has the Lich King made me to be a fool. Finally, he has been made to pay for the atrocities he imposed upon my people.\n\nMay Azeroth never fail to remember the horrible price we paid for our weakness, for our pride. But what now, Hero? What of those freed from his grasp but still shackled to their mortal coils?\n\nLeave me. I have much to ponder.",questID=24918,u=3301,g={toy(52253,{lvl=80,u=3301})}}),i(51318,{b=1,description="Jaina: What's this?\nHe... he kept it.. all this time he kept it!\n<Cries> I knew!\n<Cries> I sensed a part of him still alive... trapped... struggling. Oh Arthas!\nPerhaps he might someday remember from what he once was...\nBy the Light may he at last find rest, free from the icy grip of that terrible blade!",questID=24916,u=3301,g={i(52251,{lvl=80,u=3301})}})}})}})}}),n(-1000031,{u=33,g={q(24815,{description="If the quest does not appear when you hit Friendly, you may have to relog.",minReputation={1156,3000},qgs={38316},u=33,g={i(50375,{b=1,c={1,2,6},f=52,lvl=80,u=33}),i(50377,{b=1,c={2,5,7,8,9,10,11},f=52,lvl=80,u=33}),i(52569,{b=1,c={1,2,6},f=52,u=33}),i(50376,{b=1,c={3,4,7,10,11,12},f=52,lvl=80,u=33}),i(50378,{b=1,c={2,5,7,8,9,10,11},f=52,lvl=80,u=33})}}),q(24827,{c={1,2,6},minReputation={1156,9000},qgs={38316},sourceQuests={24815},u=33,g={i(50388,{b=1,c={1,2,6},f=52,lvl=80,u=33})}}),q(24834,{c={1,2,6},minReputation={1156,21000},qgs={38316},sourceQuests={24827},u=33,g={i(50403,{b=1,c={1,2,6},f=52,lvl=80,u=33})}}),q(24835,{c={1,2,6},minReputation={1156,42000},qgs={38316},sourceQuests={24834},u=33,g={i(50404,{b=1,c={1,2,6},f