r several zones.",maps={1463},g={n(-1000004,{ach(42,{sym={{"meta_achievement",760,761,765,766,775,777,627,778,771,776,859,858,772,868,779,780,774,769,781,782,773,768,770,802,841}}}),ach(1676,{OnClick=handlers.LOREMASTER_CONTINENT_OnClick,OnTooltip=handlers.LOREMASTER_OnTooltip,OnUpdate=function(t) return handlers.LOREMASTER_CONTINENT_OnUpdate(t, 1415); end,r=2}),ach(1677,{OnClick=handlers.LOREMASTER_CONTINENT_OnClick,OnTooltip=handlers.LOREMASTER_OnTooltip,OnUpdate=function(t) return handlers.LOREMASTER_CONTINENT_OnUpdate(t, 1415); end,r=1,rwp=40003})}),m(1455,{icon="Interface\\Icons\\Inv_misc_tournaments_symbol_dwarf",isRaid=1,lore="Ironforge is the capital city of the dwarves, proud members of the Alliance. It is the ancestral home of the Bronzebeard dwarves. King Bronzebeard rules the kingdom of Khaz Modan from the throne room within the city. The Great Forge area gave the city its name.\n\nCarved into the stone heart of Khaz Modan, the mighty city of Ironforge is a testament to the dwarves' strength and resilience. The city is perhaps the most intricate of the Alliance cities, boasting many small passageways, shops built into the rock walls, and cavernous rooms. The feel of the city is a bustling, rowdy, and somewhat industrial one. However, it is predominantly safe-feeling and cozy; fires roar in the hearths of the inns and shops, and much dwarven laughing and frivolity is to be heard. Also, unlike Stormwind and Darnassus, the city is actually a massive cavern carved into the earth by the dwarves; the ceiling and floor are both hard stone.\n\nMainly because of the Deeprun Tram, linking Ironforge and Stormwind City, and the district of Tinker Town, Ironforge is one of the most racially diverse cities in the Alliance world. Dwarves predominate, of course, but you will find plenty of gnomes even outside of Tinker Town, and probably as many humans. You will find almost no night elves however, as they probably prefer more natural and open spaced environments.",g={n(