 Draenor. Nethergarde Keep, a Stormwind fortress of dour mages and paladins, keeps watch over the portal and the demons and ogres that would abuse its power.\n\nNow, the wretched land hosts few inhabitants and no significant settlements. Magic that leaked through the Dark Portal warped the Blasted Lands, leaving an infertile desert landscape. Hardy desert species like Basilisks, Scorpions and Hyenas have since colonized the area. The red rocks of the region do not come by their color naturally. The original tan color was transmuted into the unearthly crimson by searing heat and chaotic energies when the Dark Portal was destroyed.",g={n(-1000004,{ach(766,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(1441,{maphash="185:155:310:133"}),exp(1437,{maphash="195:180:361:15"}),exp(1439,{maphash="245:195:361:195"}),exp(1457,{maphash="170:200:472:9"}),exp(1438,{maphash="185:190:559:30"}),exp(2517,{maphash="170:145:405:123"}),exp(1440,{maphash="225:170:501:140"}),exp(72,{maphash="265:220:453:259"}),exp(73,{maphash="384:450:212:178"})}),n(-1000021,{fp(45,{coords={{65.6,24.4,1419}},crs={8609},r=2})}),n(-1000031,{q(2583,{coords={{50.6,14.2,1419}},cost={{"i",8392,3},{"i",8393,2},{"i",8394,1}},lvl=45,qgs={7505},rwp=40003,g={i(8411,{b=1,f=55,rwp=40003})}}),q(3501,{coords={{51.8,35.6,1419}},cost={{"i",10593,1}},lvl=45,qgs={7363},rwp=40003,g={i(12122,{b=1})}}),q(2602,{coords={{50.6,14.3,1419}},cost={{"i",8394,10},{"i",8396,2}},lvl=45,qgs={7506},repeatable=1,rwp=40003,g={i(8423,{b=1,f=55,rwp=40003})}}),q(2522,{coords={{51.8,35.6,1419}},cost={{"i",8244,1}},lvl=45,qgs={7363},repeatable=1,rwp=40003,sourceQuests={2521},g={i(10752,{b=1})}}),q(3502,{coords={{51.8,35.6,1419}},cost={{"i",10593,1}},lvl=45,qgs={7363},repeatable=1,rwp=40003,sourceQuests={3501},g={i(12122,{b=1})}}),q(2783,{coords={{67.6,19.2,1419}},lvl=50,maps={1435},qgs={7826},r=2,rwp=40003}),q(2582,{coords={{50.6,14.2,1419}},cost={{"i",8391,3},{"i",8392,2},{"i",8393,1}},lvl=45,qg