 place. The tower of Karazhan to the south served as his bastion until his final days.\n\nThe Karazhan Crypts can be explored by players who kill themselves and traverse the gates as a ghost. The crypt is filled to the brim with disturbing content, the most disturbing being a pool filled with human bodies hanged upside down and roped to chains. This area became known to players as the Upside-Down Sinners.",maps={41,43,44,45,46},g={n(-1000004,{ach(777,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(2697,{maphash="380:365:249:76"}),exp(2562,{maphash="300:245:269:337"}),exp(2561,{maphash="270:270:426:299"})}),n(-1000039,{n(18255,{coords={{47.2,75,1430}},u=17,g={r(38503,{b=1,itemID=31401,requireSkill=755,u=17}),r(42620,{awp=20300,b=1,itemID=33165,requireSkill=333,u=19}),r(42546,{awp=20200,b=1,itemID=33124,requireSkill=165,u=19}),r(42731,{awp=20200,b=1,itemID=33205,requireSkill=165,u=19}),r(42736,{itemID=33209,requireSkill=171,rwp=50001,u=19}),i(29187,{b=1,lvl=70,u=17}),i(34581,{b=1,f=37,lvl=70,rwp=40001,u=19}),i(34582,{b=1,f=37,lvl=70,rwp=40001,u=19})}})}),n(-1000044,{r(20010,{crs={7372},itemID=16246,requireSkill=333})})}}),m(499,{icon="Interface\\Icons\\INV_Misc_EngGizmos_03",lore="The Deeprun Tram is a long, fully enclosed, underground (and partially underwater) set of double tracks upon which rolls two sets of three wagons, all credited to the gnomes' technical engineering. The service is fast and smooth, and is provided free of charge to travelers between the Alliance-aligned cities of Ironforge and Stormwind City.",["zone-text-areaID"]=2257,g={n(-1000031,{q(6661,{lvl=10,qgs={12997},r=2,g={qo(1,{crs={13016},providers={{"i",17117}}})}}),q(6662,{cost={{"i",17118,1}},lvl=10,qgs={12997},r=2,sourceQuests={6661},g={i(17119,{f=55,lvl=5})}})})}}),m(1426,{icon="Interface\\Icons\\achievement_zone_dunmorogh",lore="Dun Morogh is home to both the gnomes of Gnomeregan and the Ironforge dwarves and is the location of the major city of Ironforge. The Khaz Modan mountains surround Dun Morogh on all sides, making it accessible only by certain passes that are currently watched over by dwarven troops.\n\nThe center of dwarven culture and ingenuity, Dun Morogh holds the capital of Ironforge. The region is snow-swept and forested, with gray, craggy mountains and slinking wolves. Troggs recently overran Gnomeregan, the gnomes' former capital, and drove its citizens to Ironforge. Frostmane trolls menace dwarven patrols. Several villages and towns dot the landscape, and though the trade routes can be perilous, dwarven mountaineers and warriors keep their settlements safe.",maps={29,31,470},g={m(427,{icon="Interface\\Icons\\Achievement_Character_Dwarf_Male",lore="Coldridge Valley is the starting area for young dwarven recruits, and contains the base camp of Anvilmar. It is located in the southwestern corner of Dun Morogh, and is linked to the greater area by Coldridge Pass to the northeast.",maps={28,428},g={sp(921),n(-1000031,{q(170,{coords={{29.6,71.2,1426}},qgs={713},r=2,rwp=40003,sourceQuests={179},g={qo(1,{providers={{"n",707}}}),qo(2,{providers={{"n",724}}}),i(6185,{b=1,f=3,rwp=40003}),i(2172,{b=1,f=6,rwp=40003}),i(6173,{b=1,f=4,rwp=40003})}}),q(3361,{coords={{28.6,67.8,1426}},lvl=3,qgs={8416},r=2,g={qo(1,{coords={{20.9,76.1,1426}},providers={{"i",10438}}}),qo(2,{coords={{22.8,79.9,1426}},providers={{"i",16313}}}),qo(3,{coords={{26.3,79.2,1426}},providers={{"i",16314}}})}}),q(1599,{altQuests={1598},c={9},coords={{28.6,66.1,1426}},qgs={460},r=2,u=2}),q(3365,{coords={{28.8,66.4,1426}},lvl=4,providers={{"i",10440}},qgs={836},r=2,rwp=40003,sourceQuests={3364}}),q(233,{coords={{29.8,71.2,1426}},providers={{"i",2187}},qgs={658},r=2,rwp=40003,sourceQuests={179}}),q(234,{coords={{22.6,71.4,1426}},providers={{"i",2188}},qgs={714},r=2,rwp=40003,sourceQuests={233}}),q(3107,{c={2},coords={{29.8,71.2,1426}},providers={{"i",9563}},qgs={658},races={3},rwp=70003,sourceQuests={179}}),q(179,{coords={{29.8,71.2,1426}