ir filthy, industrious works. The Searing Gorge was the obvious choice due to a low military presence, scarce population, few settlements, and high vulnerability. The dwarven garrisons were soon overrun by a massive Dark Iron invasion which forced them to retreat to Loch Modan and seal the passage.",g={n(-1000004,{ach(774,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(1442,{maphash="405:430:85:30"}),exp(1959,{maphash="460:365:422:8"}),exp(247,{maphash="305:220:494:300"}),exp(1957,{maphash="275:235:77:366"}),exp(246,{maphash="425:325:250:170"}),exp(1444,{maphash="360:280:247:388"}),exp(1958,{maphash="305:230:545:407"})}),n(-1000021,{fp(74,{coords={{37.8,30.6,1427}},crs={2941},r=2}),fp(75,{coords={{34.8,30.6,1427}},crs={3305},r=1})}),n(-1000030,{prof(165,{n(7868,{coords={{63.6,75.8,1427}},r=2,rwp=40003,g={r(36074,{awp=20005,requireSkill=10658,rwp=40003,u=17}),r(36077,{awp=20005,requireSkill=10658,rwp=40003,u=17}),r(35590,{awp=20005,requireSkill=10658,rwp=40003,u=17}),r(35591,{awp=20005,requireSkill=10658,rwp=40003,u=17}),r(35589,{awp=20005,requireSkill=10658,rwp=40003,u=17}),r(10658,{rwp=40003}),r(10630,{rwp=40003}),r(10632,{rwp=40003})}})})}),n(-1000031,{q(4449,{coords={{65.5,62.2,1427}},cost={{"i",4306,15}},lvl=43,providers={{"o",173265}},rwp=40003,g={qo(1,{providers={{"n",5839}}})}}),q(7723,{coords={{38.6,27.8,1427}},lvl=45,qgs={14627},rwp=40003,g={qo(1,{providers={{"n",5854}}}),i(19126,{b=1,f=7,rwp=40003})}}),q(3441,{coords={{39.1,39,1427}},lvl=40,qgs={8479},rwp=40003}),q(3371,{coords={{71.4,16.2,1455}},lvl=40,qgs={8256},r=2,rwp=40003,sourceQuests={3368}}),q(7724,{coords={{38.6,27.8,1427}},lvl=45,qgs={14627},rwp=40003,g={qo(1,{providers={{"n",5858}}}),i(19125,{b=1,f=6,rwp=40003})}}),q(3443,{coords={{39.1,39,1427}},lvl=40,qgs={8479},rwp=40003,sourceQuests={3442},g={qo(1,{crs={5839,5840,5843,5844,5846,8337,8504,8566,8637,15692},providers={{"i",10551}}})}}),q(13662,{awp=30300,coords={{38.8,28.5,1427}},cost={{"i",18945