for the Wildhammer dwarves who make their residence at Aerie Peak in the west. The Wildhammers have always been staunch allies of the Alliance. It is from the Hinterlands that these dwarves find and tame their world-renowned gryphons. The Razorbeak gryphons roam wild in this region.\n\nAlso in the Hinterlands is one of the last remaining settlements of the high elves in Lordaeron at the Quel'Danil Lodge.\n\nThe Hinterlands are also home to a large population of forest trolls, which are divided into three separate tribes. The Revantusk tribe is the only one of the three that has declared sides in the Horde/Alliance conflict and support the warchief Thrall of the Horde. The Vilebranch tribe holds residence in the massive troll city of Jintha'Alor as well as the Altar of Zul while the Witherbark tribe holds the smallest influence, hailing from the temples of Shadra'Alor.",g={n(-1000004,{ach(773,{OnClick=handlers.EXPLORATION_OnClick,OnUpdate=handlers.EXPLORATION_OnUpdate})}),n(-1000019,{exp(1886,{maphash="180:170:408:260"}),exp(1882,{maphash="145:220:158:149"}),exp(350,{maphash="185:195:237:185"}),exp(351,{maphash="160:145:512:232"}),exp(1917,{maphash="280:205:571:239"}),exp(356,{maphash="275:275:509:19"}),exp(307,{maphash="170:310:693:303"}),exp(354,{maphash="235:285:505:333"}),exp(353,{maphash="195:185:240:387"}),exp(1885,{maphash="225:200:171:306"}),exp(348,{maphash="255:205:13:245"}),exp(1884,{maphash="205:195:374:164"}),exp(1883,{maphash="170:170:319:302"}),exp(355,{maphash="200:165:373:365"})}),n(-1000021,{fp(43,{coords={{11,46,1425}},crs={8018},r=2}),fp(76,{coords={{81.6,81.8,1425}},crs={4314},r=1})}),n(-1000030,{prof(165,{n(11097,{coords={{13.4,43.4,1425}},r=2})})}),n(-1000031,{q(9470,{awp=20001,coords={{15.1,47.2,1425}},lvl=41,qgs={17223},r=2,rwp=40003,g={qo(1,{coords={{24.6,65.4,1425}},providers={{"n",17235}}}),qo(2,{coords={{24.8,65.6,1425}},providers={{"n",17236}}})}}),q(77,{coords={{26.6,48.4,1425}},lvl=42,qgs={7801},r=1,rwp=40003,sourceQuests={650},g={qo(1